import React from "react";
import { View, StyleSheet, FlatList, Dimensions } from "react-native"
import { Button, Text } from "react-native-paper";
import HomeController from "./HomeController";
import { lot } from "../model/lot";
import Icon from 'react-native-vector-icons/FontAwesome';

let deviceWidth = Dimensions.get('window').width;
let column: number = 3;
let columnHeight: number = 100;

export default class HomeView extends HomeController {

    renderItem = (item: lot) => {
        console.log("item", item)
        return (
            <View style={styles.viewStyle}>
                <Text>y{item.id}</Text>
            </View>
        );
    }

    render() {
        console.log("Hiiiii, this.state.arrLot", this.state.arrLot.length);
        return (
            <View style={styles.view}>
                <View style={styles.separator} />
                <Button mode="contained" onPress={() => {
                    this.onPressAddCar();
                }}>
                    Add Car
                </Button>
                <View style={styles.separator} />

                <FlatList
                    style={{ width: deviceWidth * 0.8 }}
                    extraData={this.state}
                    data={this.state.arrLot}
                    renderItem={({ item, index }) => {
                        return (
                            <View style={styles.viewStyle}>
                                <Button icon="logout">
                                    Exit
                                </Button>
                                <Icon name="car" size={35} color="#00000" />
                            </View>
                        );
                    }}
                    numColumns={column}
                    keyExtractor={(item, index) => index.toString()}
                />
            </View>
        );
    }
}

const styles = StyleSheet.create({
    view: {
        flex: 1,
        alignItems: "center",
        backgroundColor: 'white',
    },
    separator: {
        height: 20,
    },
    viewStyle: {
        height: columnHeight,
        margin: 10,
        padding: 10,
        backgroundColor: "#d1d1d1",
        alignItems: "center",
        width: ((deviceWidth * 0.7) - (column * 10)) / column,
    },
    icon: {
        height: columnHeight,
        margin: 10,
        padding: 10,
        width: ((deviceWidth * 0.7) - (column * 10)) / column,
    }
});
